const Minecraft = () => {
    return (
        <div>
            <h1>Servidor Minecraft</h1>
            <p>Controla y monitorea tu servidor de Minecraft aquí.</p>
            <MinecraftConsole/>
            {/* Aquí puedes agregar botones y controles para gestionar el servidor */}
        </div>
    );
};

export default Minecraft;
